import { Injectable } from '@angular/core';
import { InfectionMeningite } from '../models/InfectionMeningite';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class MeningiteService {

  private apiUrl = 'https://localhost:7129/api/InfectionMeningites';

  constructor(private http: HttpClient) { }
  addmen(InfectionMeningite: InfectionMeningite): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', InfectionMeningite);

    return this.http.post<any>(`${this.apiUrl}/addmen`, InfectionMeningite, { observe: 'response' });
  }}
